import React, { useEffect, useState } from "react";
import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import CardActions from "@mui/material/CardActions";
import Carousel from "react-material-ui-carousel";
import { Paper, Button } from "@mui/material";
import Box from "@mui/material/Box";
import { Splide, SplideSlide } from "@splidejs/react-splide";
import "@splidejs/react-splide/css";

function ProfileCard() {
  const [ProfilePictures, setProfilePictures] = useState([]);
  useEffect(() => {
    getProfilePictures();
  }, []);

  const getProfilePictures = async () => {
    const response = await fetch(`./FakeData/ProfilePictures.json`);
    const data = await response.json();
    setProfilePictures(data.ProfilePictures);
  };

  return (
    <Card sx={{ maxWidth: 345 }}>
      <Splide
        aria-label="ProfilePictures"
        options={{
          rewind: true,
        }}
      >
        {ProfilePictures.map((pic) => (
          <SplideSlide>
            <CardMedia
              component="img"
              alt={pic.PictureTitle}
              height="140"
              image={pic.Path}
            />
          </SplideSlide>
        ))}
        <Typography
          variant="h5"
          sx={{
            position: "absolute",
            bottom: "10px",
            left: "20px",
            color: "White",
            backgroundColor: "rgba(0, 0, 0, 0.2)",
          }}
        >
          Gal
        </Typography>
      </Splide>
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Inbar
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Random Modal
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Gals are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
    </Card>
  );
}

export default ProfileCard;
